    [],nt"num_tags": 2,nt"name": "kirwin-national-wildlife-refuge-narrative-report-january-to-december-1954",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Kirwin National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1954.
    The report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, mammals, and raptors- is also covered. The Refuge
    development and maintenance section discusses physical developments, plantings,
    and collections and receipts. Resource management is outlined; topics include haying
    and commercial fishing. The public relations section of the report describes recreational
    uses and Refuge visitors. Items of interest and N-R forms are attached.",nt"owner_org":
